import { Link } from 'react-router-dom'

export function MovieDisplay({ movies }) {
  const Loaded = ({ movie }) => {
    return (
      <Link to={`/${movie.id}`}>
        <div>
          <h2>{movie.title}</h2>
          <img src={movie.poster} alt={movie.title} />
        </div>
      </Link>
    )
  }
}
